class DateInput extends React.Component {
    constructor(props) {
      super(props);

      //Setting the default startDate to (now - 10 weeks) and endDate to now
      let now = new Date();
      this.state = {startDate: now.setDate(now.getDate() - 70), endDate: new Date()};

      console.log(this.state);
      this.handleChange.bind(this);
    }
  
    render() {
      return (
        <div>
            <TextField
            name="startDate"
            id="startDate"
            label="Start Date"
            type="date"
            defaultValue="2017-05-24"
            className={classes.textField}
            InputLabelProps={{shrink: true}}
  />
              <TextField
            name="endDate"
            id="endDate"
            label="End Date"
            type="date"
            defaultValue="2017-05-24"
            className={classes.textField}
            InputLabelProps={{shrink: true}}
  />

        </div>
      );
    }
  }

  export default DateInput;
